export default class Queue {
    constructor () {
        this.queue = [];
    }

    empty() {
        return !this.queue.length;
    }

    push(val) {
        this.queue.push(val);
    }

    pop() {
        return this.queue.pop();
    }

    size() {
        return this.queue.length;
    }
}
